        <script type="text/javascript" src="https://unpkg.com/voximplant-websdk@beta"></script>
        <script>
		$(document).ready(function(){
		let playing = false;
		$('#play-ringtone').on('click', function(){
			if (playing == false) {
				//document.getElementById("player-ring").muted = false;
				document.getElementById("player-ring").play();
			  playing = true;
			} else {
			  document.getElementById("player-ring").pause();
			  playing = false;
			}
		});
		
		$('.continue-btn').on('click', function(){
			$('.continue-to-dashboard').hide();
		});
		
		let call;
            const sdk = VoxImplant.getInstance();
			const login = async () => {
				try {
					await sdk.init();
						console.log("SDK is ready!");
					try {
						await sdk.connect();
						console.log("Connected");
					} catch (e) {
						console.log("Connection failed!");
					}
					try {
						await sdk.login("{{$voximplant_username}}","{{$voximplant_password}}");
						console.log("Logged in!");
						
						
					} catch (e) {
						console.log(e);
					}
				} catch (e) {
					console.log("SDK init failure!");
				}
			};
			login();


			// subscribe to the IncomingCall event
			sdk.on(VoxImplant.Events.IncomingCall, (e) => {
				
				
				if(e.call.number() == 'sip:{{$team_voximplant_phone}}@catdump.sulemankhan.voximplant.com'){
					document.getElementById("player-ring").play();
					$('.calling').text('Incoming Call');
					
					$('.caller-number').text(e.call.displayName());
					$('#voximplant-incoming-call').show();
					$('.call-actions').show();
					$('.back-to-vendors-show').hide();
					$('.animation .cercle').show();
					$('span.icon.ring').css('animation','ring 0.6s infinite');
				}
				
				// add function to answer a call
				document.getElementById("answer").onclick = () => {
					e.call.answer();
				};

				// add function to decline a call
				document.getElementById("endcall").onclick = () => {
					e.call.decline();
				};


				// subscribe to the necessary events
				e.call.addEventListener(VoxImplant.CallEvents.Connected, () => {
					
					console.log("Call connected!");
					//$('#play-ringtone').click();
					document.getElementById("player-ring").pause();
					$('.calling').text('Call connected!');
					// you can process ending the call here, for example
					document.getElementById("endcall").onclick = () => {
						e.call.hangup();
					};
				});
				
				
				e.call.addEventListener(VoxImplant.CallEvents.Disconnected, () => {
					console.log("Call disconnected!");
					document.getElementById("player-ring").pause(); //$('#play-ringtone').click();
					
					$('.calling').text('Call disconnected!');
					
					$('.call-actions').hide();
					$('.back-to-vendors-show').show();
					$('.animation .cercle').hide();
					$('span.icon.ring').css('animation','none');
					$('#voximplant-incoming-call').hide();
				});
				e.call.addEventListener(VoxImplant.CallEvents.Failed, (e) => {
					console.log("Call failed!");
					document.getElementById("player-ring").pause(); //$('#play-ringtone').click();
					
					$('.calling').text('Call failed!');
					
					$('.call-actions').hide();
					$('.back-to-vendors-show').show();
					$('.animation .cercle').hide();
					$('span.icon.ring').css('animation','none');
					$('#voximplant-incoming-call').hide();

				});
			});
	
		});
        </script>